import { Fragment } from "react";
import QuoteList from "../components/quotes/QuoteList";
const DUMMY_DATA = {
  id: "p1",
  author: "Alisher",
  text: "how to beat BORING state?",
};
const Quotes = () => {
  return (
    <Fragment>
      <QuoteList quotes={DUMMY_DATA} />
    </Fragment>
  );
};
export default Quotes;
